import './NameHeader.css'

const NameHeader = () => {
    return (
        <div class="main">
            <div id="name-wrap">
                <img class="my-name hvr-icon-pop" src="https://i.imgur.com/4Br6mmd.png"/>
                <h2>Front End / Full Stack Developer</h2>
            </div>
        </div>
    )
}

export default NameHeader;
